import React from 'react'

export default function ShowPost() {
    return (
        <div>
        <ul className="formSaved">
              {this.state.list.map(item => {
                return (
                  <li key={item.id}>
                    {item.value}
                    <button onClick={()=>this.deleteItem(item.id)}>X</button>
                  </li>
                )
              })}
            </ul>

        </div>
    )
}
